  CONSTRAINT `entity_case_ibfk_1` FOREIGN KEY (`catalog_id`) REFERENCES `entity_catalog` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

